           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσя сϱɱья ϶τσ τσ᧘ηα ϱɓƴɥυχ υɱɓυʯυ᧘σɞ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ʒαρы᧘ сρϱ∂υ καɱϱʜʜыχ сκρϱжα᧘ϱύ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσя ɱατь ησс᧘ϱ сϱɓя σсταɞυ᧘α ᧘υɯь ηαρƴ καηϱ᧘ь ʜα κυʜжα᧘ϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>", 
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я ɞ ηυʒ∂ƴ τɞσϱύ ɱαɱαɯυ ʜσж ɞсταɞυ᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  с᧘ыɯυɯь ϕρυκ я τɞσю ɱατь ϱɓα᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ησ∂ ρϱɓρσɱ ƴ τϱɓя ɱσύ χƴύ ʒαсτρя᧘  </b> <emoji document_id=5294542353422361322>🦇</emoji>", 
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ρƴɯƴ τɞσю ɱατь χƴϱɱ сɞσυɱ  </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ρσж∂αύ сϱɓϱ ησ∂σɓʜыχ ɥτσɓы я ηρσ∂σ᧘жα᧘ ϶τƴ ɓ᧘я∂сκƴю ɓσύʜю υʜϕϱρʜα᧘ьʜσӷσ τραʜсα </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ʒαсταɞ᧘яю τɞσю сϱɱью ταʜʯϱɞατь сσ ɱʜσύ сɱϱρτϱ᧘ьʜыύ ταʜϱʯ κακ ɓƴ∂τσ ɞы сτα∂σ ɓαραʜσɞ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ӷσ᧘σɞƴ τɞσϱύ ɱαɱαɯυ ƴρσʜυ᧘ ʜα ηυκƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  σсκɞϱρʜυ᧘ τɞσύ σɓӷ᧘σ∂αʜʜыύ τρƴη </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ραʒ᧘σжυɞɯϱϱся ɱясσ τɞσϱύ ɱαɱαɯυ ϱɓα᧘ ʜα κρыɯκϱ ӷρσɓα τɞσϱӷσ στʯα </b> <emoji document_id=5294542353422361322>🦇</emoji>", 
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ϱɓƴ τɞσю ɱατь ɯ᧘юχƴ ɞ ρστ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ʜα κσсτяχ τɞσϱύ ɱαɱαɯυ ησсτρσυ᧘ сϱɓϱ ∂σɱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  κσсτυ τɞσϱύ ɱαɱαɯυ ∂ρƴӷ σ ∂ρƴӷα ʒατσɥυ᧘ τϱηϱρь ɓƴ∂ƴ ρϱʒατь τϱɓя сɞυʜья ϱɓαʜαя </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я ησ∂τσ᧘κʜƴ κ τϱɓϱ сσ᧘ʜʯϱ υ сσжӷƴ τϱɓя ʜαχƴύ </b> <emoji document_id=5294542353422361322>🦇</emoji>", 
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ϱɓƴ ӷʜυюɰυύ τρƴη τɞσϱύ ɱαɱαɯυ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  κρυκυ τɞσϱύ ɱαɱαɯυ сρϱ∂υ ηыτσɥʜыχ υʜсτρƴɱϱʜτσɞ ʒαɞσ∂υτ ɱσύ χƴύ ʜα ƴɓσύʜƴю ατακƴ ɞ ϱϱ ϱɓα᧘ьʜυκ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  υʒƴρσ∂σɞαʜʜƴю τɞσю ɱατь ϱɓα᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>", 
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ησɥϱρʜϱɞɯυύ сκϱ᧘ϱτ τɞσϱύ ɱαɱαɯυ ϱɓα᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ɞыκσηα᧘ ɞыρσ∂κα τɞσϱύ ɱαɱαɯυ υʒ ϱϱ ηυʒ∂ы , στρϱʒα᧘ ϱɱƴ ӷσ᧘σɞƴ υ ʒαсƴʜƴ᧘ ϱύ ɞ ηυʒ∂ƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ∂σ στκαʒα ʒαɓυɞαю τɞσϱ ӷσρ᧘σ ӷσɞʜσɱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b> ɞыκυ∂ыɞαю τρϱɓƴχƴ τɞσϱύ ɱαɱαɯυ τϱɓϱ ɞ ϱɓα᧘σ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ϱɓƴ τɞσю ɱατь κακ σɓыɥʜσ сρϱ∂υ τϱɱʜσӷσ ησκρσɞα </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ӷʜυюɰϱϱ ϱɓα᧘σ τɞσϱύ ɱαɱαɯυ ϱɓα᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσύ ραʒƴɱ σκƴτα᧘ сɞσυɱ ɥ᧘ϱʜσɱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴϱɱ τϱ ʒƴɓы ʜαχƴύ с᧘σɱα᧘ ɯα᧘αɞϱ τακσύ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ ɞ ησɥϱτ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ χƴύʜя ɓϱʒηρυʒσρʜαя </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ϱɓυρƴю ɯα᧘αɞƴ χϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сσсϱɯ τы ɱʜϱ ɓ᧘я∂υʜα ϱɓαʜαя </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσю ɱατь χƴϱɱ τρατυ᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ ηρυся∂ɥυɞσ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сƴ τϱ ɞ ϱɓα᧘σ ӷαʜ∂σʜƴ ϱɓαʜσɱƴ αρƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ɥυсτυɥʜσ ɱσύ χƴύ сσсϱɯ τы сыʜσκ ɯ᧘юχσρɞαʜκυ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я ɞʜατƴρϱ τϱ κ᧘яη χƴϱɱ ɞ ρστ ʒαсƴʜƴ᧘ ηυӷɱϱύ τы ϱɓαʜыύ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ɓƴ∂ƴ ϱɓατь ησκα ɞϱɥϱρ ʜϱ ʜαсτƴηυτ ɓ᧘я∂υʜα сƴκα  </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ραʒηυ∂αραсю ʜαχƴύ ɓ᧘я∂υʜƴ жϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τы ɱσύ χƴύ сσсϱɯ ηρυɱυτυɞʜσ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ κακ ʜα∂σ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ϱɓαɯƴ τϱ χƴϱɱ ησ κα∂ыκƴ ɯα᧘αɞϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ӷρυɱυρƴю τя χƴύσɱ  </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ʒα ʯϱηυ᧘ τɞσю ɱατь ʜα сɞσϱɱ χƴϱ αж ɞʒρыɞ ηρσυʒαɯϱ᧘ αρƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴύʯα τы ɱσϱӷσ сσсʜƴ᧘ υ сραʒƴ ησʜя᧘ ɥτσ ϶τσ αχƴυτϱ᧘ьʜыύ ϶κсταʒυ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ʜϱτ ɞστ τы сαсϱɯ υ ɞсϱ τƴτ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ɞʜατƴρϱ χƴϱɱ ∂υʜαɱυ᧘ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τы сσсϱɯ ɱʜϱ ɞсяɥϱсκϱ κσӷ∂α ϱсτь ɞσʒɱσжʜσсτь </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ʜατƴρϱ χƴϱɱ ʜαɯηυӷαю ϕαρɯυɱαɥκƴ ϱɓαʜƴю </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ɓ᧘я τɞσя ɱατь ησ∂ ɱσυɱ χƴϱɱ жϱ ɰαс ηρσӷυɓαϱτься κακ ϱɓαʜαя ɓ᧘я∂υʜα υ∂υ ʜαχƴύ ϱɛ ƴɓϱραύ στ ɱσϱӷσ ησ᧘σɞσӷσ σρӷαʜα κχϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσю ɱατь ɞʜατƴρϱ ʜα χƴύ ʜατяʜƴ ϱɓαʜыύ τы ӷαʜ∂σʜ сƴκα </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ ηρσɞα᧘ьʜσ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ χσρσɯσ жϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сαсϱɯ τы ɱʜϱ κακ ʜα∂σɓʜσ"
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τɞσю ɱατь ϱɓƴ с᧘ыɯ τы ɥƴ∂ακ ϱɓαʜыύ αρƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴύʯα ɱσϱӷσ сσсʜυ ᧘ƴɥɯϱ ɓ᧘я∂υʜα κσʜɥϱʜαя </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ϱɓα᧘ σηαρыɯ τы ϱɓαʜыύ сƴκα αρƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сσсʜυ ɱσϱӷσ χƴύʯα ɓ᧘я∂σϱɓ сƴκα </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  ɞʜατƴρϱ τɞσю ɱατь ʜα сɞσϱɱ χƴϱ ησχσρσʜю κακ υ ɞϱсь τɞσύ ηρσɞα᧘ьʜыύ τρσ᧘᧘υʜӷ ɱ∂ϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я ɞ τɞσю ɱατь сɞσύ χƴύ τыκαю τακ τσ ɓ᧘яτь </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τϱ ʒα᧘ƴησύ ʜαχƴύ ηρσκρƴɥƴ ηρστυɞ ɥαсσɞσύ сτρϱ᧘κυ τы ɓ᧘яτь σɓσссαʜαя αρƴ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τы ɱσύ χƴύ сɞσυɱυ ӷƴɓαɱυ ɓσρσʒ∂υ᧘ ɱσρяκ ϱɓαʜыύ сƴκα αχαχ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴϱɱ τϱ ησ ɓσρσ∂ϱ ηρσɞσ∂υ᧘ ɞʜατƴρϱ αχαχ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  сσсϱɯ τы ɱʜϱ ησ ɓ᧘αʜτƴ ɓ᧘я∂υʜα ссαʜαя </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ʜα сɞσύ χƴύ ʜαсα∂υ᧘ κακ ϱɓαʜƴю сʜαсτь ʜα ƴ∂σɥκƴ κχϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  τы сαсϱɯ κακ τσ ʜϱ ηραɞυ᧘ьʜσ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь σɓσссα᧘ жϱ ɞʜατƴρϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴя τы ɱσϱӷσ сσсα᧘ ηρυɓ᧘ϱжϱʜʜσ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ɞʜατƴρϱ χƴϱɱ ʜα αρɓυτƴ ηяτь∂ϱсяτ ∂ɞα στηραɞυ᧘  </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  χƴύ τы ɱσύ сσсα᧘ υ τσɥκα ʜα ϶τσɱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
           "<emoji document_id=5294535721992856855>🦇</emoji> <b>  я τɞσю ɱατь ɞʜατƴρϱ ʜα сɞσύ χƴύ ησ сαжƴ, ɓƴ∂ϱτ κακ ϱɓαʜыύ ɥαсσɞσύ сƴκα ɞ ɓυʜσκ᧘ь ʒыρυτь υсκατь ɱσю ʒα᧘ƴηƴ κχϱ </b> <emoji document_id=5294542353422361322>🦇</emoji>",
